import React, { useEffect } from "react";
import PropTypes from "prop-types";
import { Link } from "react-router-dom";

const TaskList = props => {
  const { tasks } = props;

  return (
    <table className="table">
      <thead>
        <tr>
          <th />
          <th>Title</th>
          <th>Body</th>
          <th>Category</th>
        </tr>
      </thead>
      <tbody>
        {tasks.map(task => {
          return (
            <tr key={task.id}>
              <td>
                <a
                  className="btn btn-light"
                  href={"http://localhost:3001/" + task.slug}
                >
                  Watch??
                </a>
              </td>
              <td>
                {/* <Link to={"/task/" + tasks.slug}>{task.title}</Link> */}
              </td>
              <td>{task.body}</td>
              <td>{task.category}</td>
            </tr>
          );
        })}
      </tbody>
    </table>
  );
};

TaskList.propTypes = {
  tasks: PropTypes.array.isRequired
};

export default TaskList;
